import logo from './logo.svg';
import './App.css';
import ListUser from "./Component/ListUser";

function App() {
  return (
      <div className="App">
        <nav>
          {/*<NavLink to="/users">Users</NavLink>*/}

        </nav>
        <Routes>
          <Route path="/" element={<ListUser/>}></Route>
        </Routes>
      </div>
  );
}
export default App;
